import React from 'react'

const SideComponent = () => {
  return (
    <div className='wrapper'>
      <div className="card">
        <span>Projects</span>
        <span>Notification</span>
        <span>Add Products</span>
      </div>
    </div>
  )
}

export default SideComponent
